import React from 'react';
import defaultProfile from './assets/defaultProfile.png';

const Navbar = ({ user = "Guest" }) => {
  return (
    <nav style={styles.navbar}>
      <div style={styles.profileContainer}>
        <img 
          src={defaultProfile} 
          alt="Profile" 
          style={styles.profileImage}
        />
        <div style={styles.nameContainer}>
          <span style={styles.welcomeText}>Welcome,</span>
          <span style={styles.userName}>{user}</span>
        </div>
      </div>

      <h1 style={styles.title}>Test</h1>

      <ul style={styles.links}>
        <li style={styles.link}><a href="/">Home</a></li>
        <li style={styles.link}><a href="/about">About</a></li>
        <li style={styles.link}><a href="/services">Services</a></li>
        <li style={styles.link}><a href="/contact">Contact</a></li>
      </ul>
    </nav>
  );
};

const styles = {
  navbar: {
    display: 'flex',
    alignItems: 'center',
    backgroundColor: '#333',
    color: '#fff',
    justifyContent: 'space-between',
  },
  profileContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  profileImage: {
    width: '60px',
    height: '60px',
    borderRadius: '50%',
    objectFit: 'cover',
    clipPath: 'circle(38% at 50% 50%)',
    marginRight: '10px',
  },
  nameContainer: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',  // Centering both "Welcome," and username horizontally
    justifyContent: 'center',
  },
  welcomeText: {
    fontSize: '14px',
    fontWeight: 'normal',
  },
  userName: {
    fontSize: '16px',
    fontWeight: 'bold',
  },
  links: {
    listStyle: 'none',
    display: 'flex',
    margin: 0,
    padding: 0,
  },
  link: {
    marginLeft: '20px',
  },
};

export default Navbar;
